To make your MicroVM reachable, use a TAP interface to get a virtual Ethernet interface on the host. Although it is possible to assign individual IP configuration to these individual interfaces, let us avoid the additional configuration effort and create a bridge instead: systemd.network = { netdevs."10-microvm".netdevConfig = { Kind = "bridge"; Name = "microvm"; }; networks."10-microvm" = { matchConfig.Name = "microvm"; networkConfig = { DHCPServer = true; IPv6SendRA = true; }; addresses = [ { addressConfig.Address = "10.0.0.1/24"; } { addressConfig.Address = "fd12:3456:789a::1/64"; } ]; ipv6Prefixes = [ { ipv6PrefixConfig.Prefix = "fd12:3456:789a::/64"; } ]; };
}; Better leave out the DHCP server and opt for static configuration instead if you rely on stable IPv4 addresses. Last, the TAP interfaces shall be attached to this central bridge. Make sure your matchConfig matches just the interfaces you want! systemd.network = { networks."11-microvm" = { matchConfig.Name = "vm-*"; networkConfig.Bridge = "microvm"; };
};

